INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100101, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", 27, 155, "獣人族", "東山奈央", 44, 2, 0, "トゥインクルウィッシュ", "A", "人助け、応援", 8, 16, "ヒヨリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100201, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", 5, 158, "ヒューマン", "種田梨沙", 47, 2, 0, "トゥインクルウィッシュ", "O", "料理、人間観察", 4, 17, "ユイ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100301, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", 12, 163, "魔族", "早見沙織", 46, 2, 0, "トゥインクルウィッシュ", "B", "読書、乗馬、お茶", 1, 18, "レイ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100401, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "探検好きのイタズラっ子", 10, 128, "ヒューマン", "諸星すみれ", 27, 5, 0, "リトルリリカル", "O", "いたずら、探検", 8, 9, "ミソギ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100501, "？？？", "ヒーローに憧れる騎士見習いの少女", 25, 146, "獣人族", "下田麻美", 40, 8, 0, "王宮騎士団（NIGHTMARE）", "O", "ヒーローごっこ", 11, 12, "マツリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100601, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "甘え上手なみんなの人気者", 22, 150, "魔族", "浅倉杏美", 42, 7, 0, "悪魔偽王国軍（ディアボロス）", "O", "サックス", 11, 13, "アカリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100701, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリン大好きゴースト娘", 23, 130, "魔族", "雨宮天", 32, 7, 0, "悪魔偽王国軍（ディアボロス）", "B", "プリンを食べること", 1, 14, "ミヤコ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100801, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ボクは誰よりも美しい", 10, 150, "エルフ", "大空直美", 40, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "AB", "鏡で自分を見ること", 10, 14, "ユキ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (100901, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "前世を信じる中二病患者、「疾風の冥姫」", 5, 159, "魔族", "髙野麻美", 45, 13, 0, "トワイライトキャラバン", "A", "小説執筆", 7, 17, "アンナ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101001, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホマホ王国のプリンセス", 22, 155, "獣人族", "内田真礼", 42, 10, 0, "自警団（カォン）", "O", "空想、ぬいぐるみ集め", 9, 16, "マホ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101101, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "人懐っこくてマシンガントークな妹系少女", 25, 156, "ヒューマン", "阿澄佳奈", 44, 3, 0, "ラビリンス", "A", "お裁縫", 8, 15, "リノ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101201, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "みんなのために超能力を使う眠り姫", 24, 156, "エルフ", "大橋彩香", 46, 6, 0, "フォレスティエ", "A", "妹と遊ぶこと、二度寝、昼寝、早寝", 12, 17, "ハツネ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101301, "", "オタク全開な魔法少女", 21, 166, "魔族", "佳村はるか", 55, 13, 0, "トワイライトキャラバン", "O", "読書、魔法", 8, 18, "ナナカ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101401, "test", "頭脳明晰な美少女名探偵", 3, 152, "獣人族", "水瀬いのり", 41, 10, 0, "自警団（カォン）", "AB", "読書、推理", 11, 15, "カスミ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101501, "test", "母性溢れる優しいみんなの「ミサト先生」", 5, 165, "エルフ", "國府田マリ子", 54, 6, 0, "フォレスティエ", "O", "絵本作り", 9, 21, "ミサト");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101601, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "天真爛漫で人気者のカリスマモデル", 10, 167, "魔族", "上坂すみれ", 48, 14, 0, "ルーセント学院", "O", "ファッション", 4, 18, "スズナ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101701, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "いつでも「なんくるないさ～」な天然娘", 7, 158, "獣人族", "高森奈津美", 53, 10, 0, "自警団（カォン）", "A", "踊り、空手", 7, 19, "カオリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (101801, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "多くの男性を魅了する無垢な女教師", 14, 162, "魔族", "伊藤静", 52, 14, 0, "ルーセント学院", "B", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, 23, "イオ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102001, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "お歌もにんじんも、ウサギさんも大好き♪", 3, 117, "獣人族", "日高里菜", 21, 5, 0, "リトルリリカル", "O", "かわいいもの集め", 4, 10, "ミミ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102101, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", 9, 150, "ヒューマン", "植田佳奈", 40, 9, 0, "サレンディア救護院", "B", "観劇、おままごと", 6, 12, "クルミ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102201, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "人見知りであまのじゃくな女の子", 22, 150, "魔族", "原紗友里", 40, 7, 0, "悪魔偽王国軍（ディアボロス）", "O", "ゲーム全般", 11, 13, "ヨリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102301, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ぷうきちといつも一緒！", 10, 148, "ヒューマン", "芹澤優", 38, 9, 0, "サレンディア救護院", "B", "屋内でできる遊び", 5, 14, "アヤネ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102501, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "お嬢さまのためにがんばるドジっ娘メイド", 12, 154, "ヒューマン", "悠木碧", 43, 9, 0, "サレンディア救護院", "O", "ご奉仕", 12, 15, "スズメ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102601, "test", "遊びと睡眠が何より大事なぐうたら娘", 1, 144, "獣人族", "小岩井ことり", 42, 11, 0, "牧場（エリザベスパーク）", "B", "あんパン", 1, 17, "リン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102701, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", 30, 154, "魔族", "橋本ちなみ", 43, 13, 0, "トワイライトキャラバン", "B", "実験、裁縫、料理", 7, 16, "エリコ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102801, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "救護院を経営する優しい庶民派お嬢様", 4, 156, "エルフ", "堀江由衣", 43, 9, 0, "サレンディア救護院", "A", "経営、お茶会", 10, 17, "サレン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (102901, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "歌って踊れる大人気アイドル", 24, 157, "ヒューマン", "日笠陽子", 40, 4, 0, "カルミナ", "B", "舞台鑑賞、ダンス", 1, 17, "ノゾミ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103001, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "トーゴクの神秘、オシエテクダサイ！", 31, 163, "ヒューマン", "佐藤聡美", 51, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "O", "忍法開発", 8, 16, "ニノン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103101, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", 22, 157, "魔族", "大坪由佳", 42, 7, 0, "悪魔偽王国軍（ディアボロス）", "AB", "占い", 12, 18, "シノブ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103201, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "一人前の商人を目指すパワフルお嬢様", 12, 157, "ヒューマン", "松嵜麗", 45, 12, 0, "メルクリウス財団", "AB", "慈善事業", 3, 18, "アキノ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103301, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "みんなを笑顔にするお笑い牧場主", 3, 142, "ヒューマン", "新田恵海", 35, 11, 0, "牧場（エリザベスパーク）", "B", "漫才", 3, 20, "マヒル");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103401, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "純情でほっとけない大人の女性", 16, 164, "エルフ", "今井麻美", 55, 12, 0, "メルクリウス財団", "A", "ウインドーショッピング", 3, 22, "ユカリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103601, "test", "礼儀正しくしっかり者のちびっ子優等生", 2, 118, "エルフ", "小倉唯", 21, 5, 0, "リトルリリカル", "A", "お勉強", 2, 8, "キョウカ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103701, "test", "義理堅くてからかい好きな剣術少女", 11, 149, "ヒューマン", "茅原実里", 43, 8, 0, "王宮騎士団（NIGHTMARE）", "A", "剣術、年長者をからかう", 8, 13, "トモ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (103801, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "読書が趣味の病弱少女", 3, 153, "獣人族", "小清水亜美", 40, 11, 0, "牧場（エリザベスパーク）", "A", "読書、お散歩", 11, 14, "シオリ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104001, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "「友達」に憧れる、エルフの森の女の子", 6, 158, "エルフ", "花澤香菜", 44, 6, 0, "フォレスティエ", "AB", "友達作りのイメトレ", 6, 13, "アオイ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104201, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 3, 163, "ヒューマン", "福原綾香", 46, 4, 0, "カルミナ", "O", "各種楽器", 6, 17, "チカ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104301, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "男勝りで情に厚いワイルド娘", 9, 168, "獣人族", "小松未可子", 54, 10, 0, "自警団（カォン）", "O", "お菓子作り", 8, 17, "マコト");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104401, "test", "かつては夜を支配した最強の吸血鬼", 5, 172, "魔族", "丹下桜", 50, 7, 0, "悪魔偽王国軍（ディアボロス）", "A", "世界征服", 5, "??", "イリヤ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104501, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "妄想大好き！　ほんとは照れ屋な女の子", 19, 157, "ヒューマン", "長妻樹里", 49, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "AB", "小説を読むこと", 11, 18, "クウカ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104601, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "弱きを助け強きをくじく猫娘", 1, 158, "獣人族", "沼倉愛美", 48, 12, 0, "メルクリウス財団", "AB", "猫とたわむれること", 3, 18, "タマキ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104701, "？？？", "素顔を見せない冷静沈着な女性騎士", 25, 171, "ヒューマン", "川澄綾子", 50, 8, 0, "王宮騎士団（NIGHTMARE）", "A", "格闘技、湯浴み", 10, 25, "ジュン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104801, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "仕事も私事も効率優先な傭兵少女", 11, 163, "ヒューマン", "田所あずさ", 49, 12, 0, "メルクリウス財団", "O", "傭兵などのアルバイト", 11, 20, "ミフユ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (104901, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "お姉ちゃんがお世話してあげるからねっ！", 24, 168, "ヒューマン", "生天目仁美", 54, 3, 0, "ラビリンス", "O", "家事全般", 10, 18, "シズル");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105001, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ちょっとおませな恋に恋する女の子", 3, 120, "魔族", "久野美咲", 22, 14, 0, "ルーセント学院", "A", "ファッション誌鑑賞、コスメ集め", 1, 11, "ミサキ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105101, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "実験が趣味の危険な科学者", 7, 166, "ヒューマン", "三石琴乃", 53, 13, 0, "トワイライトキャラバン", "A", "研究、実験", 3, 27, "ミツキ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105201, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "乙女チックなもふもふアニマル", 14, 150, "獣人族", "徳井青空", 100, 11, 0, "牧場（エリザベスパーク）", "A", "毛繕い、お喋り", 3, 18, "リマ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105301, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "見た目も中身もお子ちゃまな異国の軍人", 28, 140, "ヒューマン", "辻あゆみ", 33, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "A", "お菓子屋通い", 7, 18, "モニカ");
