INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105601, "test", "人情味溢れる粋でいなせな「姉御」", 11, 167, "ヒューマン", "佐藤利奈", 54, 13, 0, "トワイライトキャラバン", "B", "釣り", 7, 25, "ルカ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105701, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "空への冒険を夢見る騎空士の少女", 10, 156, "ヒューマン", "金元寿子", 45, "", 0, "？？？", "O", "冒険、おしゃべり", 3, 17, "ジータ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (105801, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", "いつも元気な腹ペコ少女", 31, 156, "ヒューマン", "M・A・O", 46, 1, 0, "美食殿", "O", "食べ歩き、料理", 3, 17, "ペコリーヌ");
