INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (107101, "", "傍若無人な王宮騎士団副団長", 7, 165, "ヒューマン", "たかはし智秋", "??", 8, 0, "王宮騎士団（NIGHTMARE）", "O", "強敵との闘争", 2, 27, "クリスティーナ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (107501, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", "いつも元気な腹ペコ少女", 31, 156, "ヒューマン", "M・A・O", 46, 1, 0, "美食殿", "O", "食べ歩き、料理", 3, 17, "ペコリーヌ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (107601, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", "主を慕う、小さなガイド役", 11, 140, "エルフ", "伊藤美来", 35, 1, 0, "美食殿", "B", "瞑想、動植物の飼育", 5, 11, "コッコロ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (107701, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "お嬢さまのためにがんばるドジっ娘メイド", 12, 154, "ヒューマン", "悠木碧", 43, 9, 0, "サレンディア救護院", "O", "ご奉仕", 12, 15, "スズメ（サマー）");
