INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (107901, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "弱きを助け強きをくじく猫娘", 1, 158, "獣人族", "沼倉愛美", 48, 12, 0, "メルクリウス財団", "AB", "猫とたわむれること", 3, 18, "タマキ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108001, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "仕事も私事も効率優先な傭兵少女", 11, 163, "ヒューマン", "田所あずさ", 49, 12, 0, "メルクリウス財団", "O", "傭兵などのアルバイト", 11, 20, "ミフユ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108101, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "占いが得意な霊能少女", 22, 157, "魔族", "大坪由佳", 42, 7, 0, "悪魔偽王国軍（ディアボロス）", "AB", "占い", 12, 18, "シノブ（ハロウィン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108201, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "プリン大好きゴースト娘", 23, 130, "魔族", "雨宮天", 32, 7, 0, "悪魔偽王国軍（ディアボロス）", "B", "プリンを食べること", 1, 14, "ミヤコ（ハロウィン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108301, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ちょっとおませな恋に恋する女の子", 3, 120, "魔族", "久野美咲", 22, 14, 0, "ルーセント学院", "A", "ファッション誌鑑賞、コスメ集め", 1, 11, "ミサキ（ハロウィン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108401, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 3, 163, "ヒューマン", "福原綾香", 46, 4, 0, "カルミナ", "O", "各種楽器", 6, 17, "チカ（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108501, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "泣き虫で臆病な守ってあげたい女の子", 9, 150, "ヒューマン", "植田佳奈", 40, 9, 0, "サレンディア救護院", "B", "観劇、おままごと", 6, 12, "クルミ（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108601, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "ぷうきちといつも一緒！", 10, 148, "ヒューマン", "芹澤優", 38, 9, 0, "サレンディア救護院", "B", "屋内でできる遊び", 5, 14, "アヤネ（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108701, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "人助けが大好き！　前向き格闘娘", 27, 155, "獣人族", "東山奈央", 44, 2, 0, "トゥインクルウィッシュ", "A", "人助け、応援", 8, 16, "ヒヨリ（ニューイヤー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108801, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", 5, 158, "ヒューマン", "種田梨沙", 47, 2, 0, "トゥインクルウィッシュ", "O", "料理、人間観察", 4, 17, "ユイ（ニューイヤー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (108901, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", 12, 163, "魔族", "早見沙織", 46, 2, 0, "トゥインクルウィッシュ", "B", "読書、乗馬、お茶", 1, 18, "レイ（ニューイヤー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109001, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", 30, 154, "魔族", "橋本ちなみ", 43, 13, 0, "トワイライトキャラバン", "B", "実験、裁縫、料理", 7, 16, "エリコ（バレンタイン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109101, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "お姉ちゃんがお世話してあげるからねっ！", 24, 168, "ヒューマン", "生天目仁美", 54, 3, 0, "ラビリンス", "O", "家事全般", 10, 18, "シズル（バレンタイン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109201, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "英霊と契約を結んだマナリアの天才王女", 1, 156, "ヒューマン", "日笠陽子", 55, "", 0, "？？？", "AB", "読書", 12, 17, "アン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (109301, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "マナリア魔法学院の新入生", 4, 144, "ヒューマン", "こやまきみこ", 45, "", 0, "？？？", "O", "食べること、眠ること", 2, 15, "ルゥ");
