INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (114401, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "一人前の商人を目指すパワフルお嬢様", 12, 157, "ヒューマン", "松嵜麗", 45, 12, 0, "メルクリウス財団", "AB", "慈善事業", 3, 18, "アキノ（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (114501, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "救護院を経営する優しい庶民派お嬢様", 4, 156, "エルフ", "堀江由衣", 43, 9, 0, "サレンディア救護院", "A", "経営、お茶会", 10, 17, "サレン（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (114601, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "純情でほっとけない大人の女性", 16, 164, "エルフ", "今井麻美", 55, 12, 0, "メルクリウス財団", "A", "ウインドーショッピング", 3, 22, "ユカリ（クリスマス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (114701, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", "さまよえる謎の少女", 11, 148, "ヒューマン", "潘めぐみ", 40, "", 0, "？？？", "O", "冒険、思い出話", 8, 16, "ムイミ（ニューイヤー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (115001, "", "研究所に隠れ住む物静かなお姉さん", 24, 149, "エルフ", "井口裕香", "??", "", 0, "？？？", "O", "物真似、芸術鑑賞", 3, 24, "ネネカ（ニューイヤー）");
