INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (116001, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホマホ王国のプリンセス", 22, 155, "獣人族", "内田真礼", 42, 10, 0, "自警団（カォン）", "O", "空想、ぬいぐるみ集め", 9, 16, "マホ（シンデレラ）");
