INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (116801, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "弱きを助け強きをくじく猫娘", 1, 158, "獣人族", "沼倉愛美", 48, 12, 0, "メルクリウス財団", "AB", "猫とたわむれること", 3, 18, "タマキ（作業服）");
