INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117001, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "運命の相手に一途すぎる乙女", 30, 154, "魔族", "橋本ちなみ", 43, 13, 0, "トワイライトキャラバン", "B", "実験、裁縫、料理", 7, 16, "エリコ（サマー）");
