INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117201, "", "歌って踊れる大人気アイドル", 24, 157, "ヒューマン", "日笠陽子", 40, 4, 0, "カルミナ", "B", "舞台鑑賞、ダンス", 1, 17, "ノゾミ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117301, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "人々を守るために歌う、唱喚士の少女", 3, 163, "ヒューマン", "福原綾香", 46, 4, 0, "カルミナ", "O", "各種楽器", 6, 17, "チカ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117401, "", "ファッション大好きなキュートガール", 7, 153, "ヒューマン", "木戸衣吹", 45, 4, 0, "カルミナ", "AB", "裁縫", 9, 14, "ツムギ（サマー）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117501, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "実験が趣味の危険な科学者", 7, 166, "ヒューマン", "三石琴乃", 53, 13, 0, "トワイライトキャラバン", "A", "研究、実験", 3, 27, "ミツキ（オーエド）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117601, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ボクは誰よりも美しい", 10, 150, "エルフ", "大空直美", 40, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "AB", "鏡で自分を見ること", 10, 14, "ユキ（オーエド）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117701, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "いつでも「なんくるないさ～」な天然娘", 7, 158, "獣人族", "高森奈津美", 53, 10, 0, "自警団（カォン）", "A", "踊り、空手", 7, 19, "カオリ（ハロウィン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117801, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "トーゴクの神秘、オシエテクダサイ！", 31, 163, "ヒューマン", "佐藤聡美", 51, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "O", "忍法開発", 8, 16, "ニノン（ハロウィン）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (117901, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "天真爛漫で人気者のカリスマモデル", 10, 167, "魔族", "上坂すみれ", 48, 14, 0, "ルーセント学院", "O", "ファッション", 4, 18, "スズナ（ハロウィン）");
