INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (119001, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "多くの男性を魅了する無垢な女教師", 14, 162, "魔族", "伊藤静", 52, 14, 0, "ルーセント学院", "B", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, 23, "イオ（ノワール）");
