INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (119201, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "みんなを笑顔にするお笑い牧場主", 3, 142, "ヒューマン", "新田恵海", 35, 11, 0, "牧場（エリザベスパーク）", "B", "漫才", 3, 20, "マヒル（クリスマス）");
