INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (121901, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "前世を信じる中二病患者、「疾風の冥姫」", 5, 159, "魔族", "髙野麻美", 45, 13, 0, "トワイライトキャラバン", "A", "小説執筆", 7, 17, "アンナ（パイレーツ）");
