INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (122501, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", 12, 163, "魔族", "早見沙織", 46, 2, 0, "トゥインクルウィッシュ", "B", "読書、乗馬、お茶", 1, 18, "レイ（サマー）");
