INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (125201, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "見た目も中身もお子ちゃまな異国の軍人", 28, 140, "ヒューマン", "辻あゆみ", 33, 15, 0, "ヴァイスフリューゲル　ランドソル支部", "A", "お菓子屋通い", 7, 18, "モニカ（カフェ）");
