INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (180201, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "戦闘のサポートが得意な、心優しい少女", 5, 158, "ヒューマン", "種田梨沙", 47, 2, 0, "トゥインクルウィッシュ", "O", "料理、人間観察", 4, 17, "ユイ（プリンセス）");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES (180301, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "クールで何事にも真っ直ぐな剣士", 12, 163, "魔族", "早見沙織", 46, 2, 0, "トゥインクルウィッシュ", "B", "読書、乗馬、お茶", 1, 18, "レイ（プリンセス）");
